[{'comment_id': 650915310, 'comment_body': "So, a request can have multiple launch types, e.g., `launch/user, launch/encounter, launch/patient` all in one go. It seems that rather than trying to pass this as a parameter, we just need to return whatever information we have a have logic here to decide which fields to populate.

Also, data passed from Keycloak to OMRS should *always* be in a token rather than in a URL parameter. This is, for example, how we pass the user to OMRS. The reason for doing this is that the token is signed by Keycloak, so we can be sure that the parameter was provided by Keycloak rather than a user. We should likely have a similar setup in the smartonfhir module when we're passing parameters around, but that's another step towards productionising this.", 'comment_created': datetime.datetime(2021, 6, 14, 12, 47, 27, tzinfo=datetime.timezone.utc), 'commenter': 'ibacher', 'type': 'User'}, {'comment_id': 650937250, 'comment_body': "I don't quite get why this was changed?", 'comment_created': datetime.datetime(2021, 6, 14, 13, 16, 46, tzinfo=datetime.timezone.utc), 'commenter': 'ibacher', 'type': 'User'}, {'comment_id': 651031148, 'comment_body': '@ibacher, thanks. Please correct me if I understood wrong. Do we need to pass the launchType (i.e., "encounter" or "patient") parameter in token securely? ', 'comment_created': datetime.datetime(2021, 6, 14, 15, 3, 1, tzinfo=datetime.timezone.utc), 'commenter': 'theanandankit', 'type': 'User'}, {'comment_id': 651035914, 'comment_body': 'So two things:

1. Yes, if we are passing the launch type, it needs to be in the token
2. But, how are we going to address a request for multiple launch parameters? This can probably be handled either by multiple challenge steps in the authenticator or handled inside OMRS.', 'comment_created': datetime.datetime(2021, 6, 14, 15, 8, 43, tzinfo=datetime.timezone.utc), 'commenter': 'ibacher', 'type': 'User'}, {'comment_id': 651036896, 'comment_body': 'Actually, we have changed the same logic to `map` in our last commit [here](https://github.com/openmrs/openmrs-contrib-keycloak-smart-auth/blob/5697511aac2e3da364f44051750d089ebe51d731/openmrs-keycloak-smart-auth/src/main/java/org/openmrs/contrib/keycloak/smart/auth/provider/SmartLaunchAccessAuthenticator.java#L175).', 'comment_created': datetime.datetime(2021, 6, 14, 15, 9, 49, tzinfo=datetime.timezone.utc), 'commenter': 'theanandankit', 'type': 'User'}, {'comment_id': 651050615, 'comment_body': '@ibacher I think handling it into the authenticator will be better because if we do this here, we only need to check the launchType in OMRS. 

So currently, we only support patient and encounter standalone launches. if the client request only for patient context (scope contain launch/patient but not launch/encounter) then we set the `launchType="patient"` but if client request for encounter context (scope contains both launch/patient and launch/encounter) then we set the `launchType="encounter"`.  By Checking the scope requested, we can easily predict the launchType. Thought? ', 'comment_created': datetime.datetime(2021, 6, 14, 15, 25, 48, tzinfo=datetime.timezone.utc), 'commenter': 'theanandankit', 'type': 'User'}, {'comment_id': 656181795, 'comment_body': '@ibacher Thought? ', 'comment_created': datetime.datetime(2021, 6, 22, 12, 42, 45, tzinfo=datetime.timezone.utc), 'commenter': 'theanandankit', 'type': 'User'}, {'comment_id': 661796253, 'comment_body': 'This still needs to be moved into the token, e.g. like we do for `user` on 148. That's the only way it's guaranteed to be signed. We should also likely just pass the scopes, maybe without launch, e.g.,

```java
externalToken.setNote("launchTypes", getLaunchScopes());

//...

private String getLaunchScopes(String scope) {
	Arrays.stream("launch/patient launch/encounter".split("\\s")).filter(it -> it.startsWith("launch/")).map(it -> it.substring(6)).collect(
			Collectors.joining(" "));
}
```

Then we do need to handle the difference in OpenMRS, but at least this way we're less directly tied to knowing that, e.g., we only care about one or the other scope.', 'comment_created': datetime.datetime(2021, 6, 30, 20, 40, 36, tzinfo=datetime.timezone.utc), 'commenter': 'ibacher', 'type': 'User'}, {'comment_id': 661796955, 'comment_body': 'Again, the idea with putting things in the token is that the token is signed and therefore we can verify that it was generated by Keycloak whereas a query parameter could be populated by a malicious user (this is a security context, so we have to be careful about security).', 'comment_created': datetime.datetime(2021, 6, 30, 20, 41, 47, tzinfo=datetime.timezone.utc), 'commenter': 'ibacher', 'type': 'User'}, {'comment_id': 663515484, 'comment_body': '@ibacher thanks, I will change this and put the `launchType` parameter into token. ', 'comment_created': datetime.datetime(2021, 7, 4, 14, 53, 18, tzinfo=datetime.timezone.utc), 'commenter': 'theanandankit', 'type': 'User'}]

